static inline __attribute__((always_inline, unused)) __attribute__((no_instrument_function)) void cpufreq_verify_within_limits(struct cpufreq_policy *policy,
  unsigned int min, unsigned int max)
{
 if (policy->min < min)
  policy->min = min;
 if (policy->max < min)
  policy->max = min;
 if (policy->min > max)
  policy->min = max;
 if (policy->max > max)
  policy->max = max;
 if (policy->min > policy->max)
  policy->min = policy->max;
 return;
}

